import { Component, OnInit, HostListener } from '@angular/core';
import { Router } from '@angular/router';
import { fabric } from 'fabric';
import { SpinnerService } from 'src/app/module/shared/UI/spinner/spinner.service';
import { DashboardService } from 'src/app/service/dashboard.service';


@Component({
  selector: 'cxr-canvas-image',
  templateUrl: './canvas-image.component.html',
  styleUrls: ['./canvas-image.component.scss'],
})
export class CanvasImageComponent implements OnInit {
  isLoading: boolean;
  patientId: string;
  PatientImage: any;
  canvas: any;
  canvasDynamicWidth: number;
  canvasDynamicHeight: number;
  xRayImage: any;
  scaleX: number;
  scaleY: number;
  show = false;

  constructor(
    private spinnerService: SpinnerService,
    private router: Router,
    private dashboardService: DashboardService
  ) {}

  @HostListener('window:resize', [])
  public onResize() {
    this.setCanvasDimension();
    this.setCanvasBackground();
  }

  ngOnInit() {
    this.spinnerService.show();
    this.canvas = new fabric.Canvas('c');
    this.patientId = localStorage.getItem('InstanceUID');
    if (!this.PatientImage) {
      this.getPatientImage(this.patientId);
    } else {
      this.setCanvasDimension();
      this.setCanvasBackground();
    }
  }

  setCanvasDimension() {
    this.canvasDynamicWidth = document.getElementById(
      'x-ray-aspect-ratio-container'
    ).clientWidth;
    this.canvasDynamicHeight = document.getElementById(
      'x-ray-aspect-ratio-container'
    ).clientHeight;
    this.canvas.setDimensions({
      width: this.canvasDynamicWidth,
      height: this.canvasDynamicHeight,
    });
  }

  /**
   * Get Patient Image
   * @param {string} instanceID Patient ID
   * @return void
   */
  getPatientImage(instanceID: string) {
    // this._service
    //   .getPatientImage(instanceID)
    //   .subscribe((data: HealthViewProcess) => {
    //     this.PatientImage = 'data:image/png;base64,' + data;
    //     sessionStorage.setItem('PatientImage', this.PatientImage);
    //     this.setCanvasDimension();
    //     this.generateCanvas();
    //   });

    this.dashboardService.getPatientList().subscribe(
      (patientsList: any) => {
        const rowData = patientsList;
        const patientId =  Number(this.patientId);
        if (patientId === rowData[0].patientId) {
          this.PatientImage =
            'data:image/png;base64,';
        } else if (patientId === rowData[1].patientId) {
          this.PatientImage =
            'data:image/jpeg;base64,';
        } else if (patientId === rowData[2].patientId) {
          this.PatientImage =
            'data:image/jpeg;base64,';
        } else {
          this.PatientImage =
            'data:image/jpeg;base64,';
        }
        sessionStorage.setItem('PatientImage', this.PatientImage);
        this.setCanvasDimension();
        this.generateCanvas();
        this.spinnerService.hide();
      },
      (errorMessage: any) => {
        this.spinnerService.hide();
      }
    );
  }

  generateCanvas() {
    fabric.Image.fromURL(this.PatientImage, (img) => {
      this.xRayImage = img;
      this.setCanvasBackground();
    });
  }

  getWidthFirst(imageaspectratio, containeraspectratio) {
    return imageaspectratio > containeraspectratio;
  }

  setCanvasBackground() {
    var canvasAspect = this.canvasDynamicWidth / this.canvasDynamicHeight;
    var imgAspect = this.xRayImage.width / this.xRayImage.height;
    var left, top, scaleFactor;

  if (this.xRayImage.width > this.xRayImage.height) {
      var scaleFactor = this.canvasDynamicWidth / this.xRayImage.width;
      left = 0;
       top = -((this.xRayImage.height * scaleFactor) - this.canvasDynamicHeight) / 2;
  } else {
       var scaleFactor = this.canvasDynamicHeight / this.xRayImage.height;
       top = 0;
      left = -((this.xRayImage.width * scaleFactor) - this.canvasDynamicWidth) / 2;
    }
    this.canvas.setBackgroundImage(
      this.xRayImage,
      this.canvas.requestRenderAll.bind(this.canvas),
      {
        opacity: 1,
        backgroundImageStretch: false,
        backgroundImageOpacity: 1,
        crossOrigin: "anonymous",
        top: top,
                left: left,
                originX: 'left',
                originY: 'top',
                scaleX: scaleFactor,
                scaleY: scaleFactor,
          
      }
    );


    // var ellipse = new fabric.Ellipse({
    //   left: 20,
    //   top: 20,
    //   rx: 150,
    //   ry: 50,
    //   fill: 'rgb(230,25,75)'
    // });
    // this.canvas.add(ellipse);

    const DiseaseList = {
      "data": {
          "names": [],
          "ndarray": [
              {
                  "Findings": {
                      "ADDITIONAL": [],
                      "BONY THORAX": [],
                      "CARDIAC SILHOUETTE": [],
                      "COSTOPHRENIC_ANGLES": [],
                      "DOMES OF DIAPHRAGM": [],
                      "HILAR/MEDIASTINAL": [],
                      "LUNG FIELDS": [
                          0,
                          1
                      ]
                  },
                  "Impression": [
                      [
                          0,
                          "calcification"
                      ],
                      [
                          1,
                          "consolidation"
                      ]
                  ],
                  "diseases": [
                      {
                          "color": "rgb(230,25,75)",
                          "confidence": 0.9941253662109375,
                          "contours": [],
                          "ellipses": [
                              {
                                  "a": 398,
                                  "b": 653,
                                  "r": 0,
                                  "x": 2716,
                                  "y": 978
                              }
                          ],
                          "idx": 0,
                          "name": "Calcification"
                      },
                      {
                          "color": "rgb(60,180,75)",
                          "confidence": 0.9983514547348022,
                          "contours": [],
                          "ellipses": [
                              {
                                  "a": 530,
                                  "b": 544,
                                  "r": 0,
                                  "x": 2782,
                                  "y": 1033
                              }
                          ],
                          "idx": 1,
                          "name": "Consolidation"
                      }
                  ]
              }
          ]
      },
      "meta": {}
  }

    this.drawMLEllipse(DiseaseList);
  }

  drawMLEllipse(DiseaseList) {
    const canvasScaleX = this.xRayImage.width / this.canvas.width;
    const canvasScaleY = this.xRayImage.height / this.canvas.height;
    DiseaseList.data.ndarray.forEach((diseaseItem) => {
      diseaseItem.diseases.forEach((diseaseItem_1) => {
        diseaseItem_1.ellipses.forEach((diseaseItem_2) => {
        console.log('diseaseItem', diseaseItem_2);
        var ellipse = new fabric.Ellipse({
          // @ts-ignore
          id: diseaseItem_2.id,
          disease: diseaseItem_2.diseases,
          left: diseaseItem_2.x / canvasScaleX,
          top: diseaseItem_2.y / canvasScaleY,
          fill: 'rgb(230,25,75)',
          opacity: 0.3,
          selectable: true,
          originX: "center",
          originY: "center",
          rx: diseaseItem_2.a / canvasScaleX / 2,
          ry: diseaseItem_2.b / canvasScaleY / 2,
          angle: diseaseItem_2.r,
          stroke: "black",
          hoverCursor: "pointer",
        })
        console.log('ellipse', ellipse);
    //    var ellipse = new fabric.Ellipse({
    //   left: 20,
    //   top: 20,
    //   rx: 150,
    //   ry: 50,
    //   fill: 'rgb(230,25,75)'
    // });
    this.canvas.add(ellipse);

    });
  });
  });
 }
}
